import React from "react";

const Services = () => {
  return (
    <div className="container-fluid d-flex justify-content-center flex-column align-items-left services-container-desktop">
      <div className="service-card">
        <h1>Logo Design</h1>
      </div>
    </div>
  );
};

export default Services;
